import React from "react";
import  "./Navbar1.css"
import logo from "./Assets/icon.png"

const Navbar1 = () => {
    return (
        <div>
            <nav className="navbar1 ">
            <div className="navbarlogo navbar-center" ><img  src={logo} width={30} /></div>
            <div className="navbartext1" >eBAZAAR</div>

            

            </nav>

        </div>
    )

}
export default Navbar1
